<script>

    $(function () {
      var base = 'BTC';
        if(base != 'USDT' && base != 'BTC' && base != 'ETH') {
            var marketCom = $("#marketlist_container_new");
        } else {
            var marketCom = $("#marketlist_container_btc");
        }

        var item = marketCom.find("[data-trade='EOS_BTC']");

            marketCom.css('display', 'block').siblings().css('display', 'none');

        if (item.length > 0) {
            item.closest('tr').addClass('coin-selected');
        }

        $("#market_controller").find("button").click(function () {
            $("#market_controller").find("button").removeClass("tn_selected");
            $(this).addClass("tn_selected").siblings().removeClass("tn_selected");

            $("#marketlist_container_usdt,#marketlist_container_btc,#marketlist_container_eth,#marketlist_container_new").css('display', 'none');

            var td = $(this).attr('value');
            if (td == 'USDT') {
                $("#marketlist_container_usdt").css('display', 'block');
                base = 'USDT';
            } else if (td == 'BTC') {
                $("#marketlist_container_btc").css('display', 'block');
                base = 'BTC';
            } else if (td == 'ETH') {
                $("#marketlist_container_eth").css('display', 'block');
                base = 'ETH';
            } else if (td == 'NEW') {
                $("#marketlist_container_new").css('display', 'block');
                base = 'NEW';
            }
          

        return false;
    });

	$('#marketSearch').keyup(function(e) {
		var needle = $(this).val();
		$.each($('.bizhong_en'),
		function() {
			var symbol = $(this).html();
			if (symbol.toLowerCase().indexOf(needle.toLowerCase()) == -1) {
				$('#' + $(this).attr('line_id')).hide();
			} else {
				$('#' + $(this).attr('line_id')).show();
				 if (e.keyCode == 13) {
					window.location = "/trade/"+symbol+"_"+base;
				}
			}
		});
	}).focus(function() {
        if ($(this).val() === 'Search...') {
            $(this).val('');
        }
    }).blur(function() {
        if ($(this).val() === '') {
            $(this).val('Search...');
        }
    });
});

</script>
